import './Header.css';
import HeaderLog from '../../images/logo.svg';
import Navigation from './Navigation/Navigation';

function Header(props) {


  return (
    <div className="header">
      <section className='header__user'>
        <img className="logo logo_place_header" src={HeaderLog} alt="Круг" />
        <div className='header__user-movies'>
          <div className="navigation">
            {p}
            <div className='navigation-button'>
              <button className='navigation-button__entrance effect' type="button">Войти</button>
            </div>
          </div>
        </div>
      </section>
    </div>
  )
}

export default Header;
